import React, { useState, useEffect } from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import API from "../../api/apiConfig";
import "./product.scss";
import Button from "../Button/Button";
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

const Product = () => {
  const [products, setProducts] = useState([]);
  const [date, setDate] = useState();
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  useEffect(() => {
    API.get(`api/product`).then((res) => {
      const product = res.data;
      console.log(product);
      setProducts(product);
    });
  }, []);
  return (
    <section className="c-Product">
      <Button name="Thêm" className="btn btn--blue" />
      <TableContainer component={Paper}>
        <Table sx={{ width: "100%" }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>
                <h1 className="c-Product__title">Tên</h1>
              </TableCell>
              <TableCell align="center">
                <h1 className="c-Product__title">Loại</h1>
              </TableCell>
              <TableCell align="center">
                <h1 className="c-Product__title">Giá</h1>
              </TableCell>
              <TableCell align="center">
                <h1 className="c-Product__title">Ngày Nhập Hàng</h1>
              </TableCell>
              <TableCell align="center">
                <h1 className="c-Product__title">Số lượng</h1>
              </TableCell>
              <TableCell align="center"></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {/* */}
            {products.map((row) => (
              <TableRow
                key={row.id}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  <span className="c-Product__text">{row.title}</span>
                </TableCell>
                <TableCell align="center">
                  <span className="c-Product__text">{row.categories}</span>{" "}
                </TableCell>
                <TableCell align="center">
                  <span className="c-Product__text"> ${row.price}</span>
                </TableCell>
                <TableCell align="center">
                  <span className="c-Product__text">{row.createdAt}</span>{" "}
                </TableCell>
                <TableCell align="center">
                  <span className="c-Product__text">
                    {row.inStock ? "còn hàng" : "hết hàng"}
                  </span>{" "}
                </TableCell>
                <TableCell align="center">
                  <div className="c-Product__detail">
                    <Button name="Xóa" className="btn btn--red" />
                    {/*Modal delete */}
                    <Dialog
                    open={open}
                    onClose={handleClose}
                    aria-labelledby="alert-dialog-title"
                    aria-describedby="alert-dialog-description"
                  >
                    <DialogTitle id="alert-dialog-title">
                      {"Use Google's location service?"}
                    </DialogTitle>
                    <DialogContent>
                      <DialogContentText id="alert-dialog-description">
                        Let Google help apps determine location. This means sending anonymous
                        location data to Google, even when no apps are running.
                      </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                      <Button onClick={handleClose}>Disagree</Button>
                      <Button onClick={handleClose} autoFocus>
                        Agree
                      </Button>
                    </DialogActions>
                  </Dialog>


                    <Button name="Sửa" className="btn btn--black" />
                    <Button name="Chi Tiết" className="btn btn--green" />
                  </div>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </section>
  );
};

export default Product;
